import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input using a different selector strategy (attribute selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Attempt XSS payload
    const xssPayload = `<img src=x onerror=alert('xss')>`;
    await page.fill('input[placeholder="Search Amazon"]', xssPayload);

    // Take screenshot after filling input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_input.png'));

    // Wait for the search button using class and nth-of-type (since there are multiple .search-btn)
    const searchBtnSelector = '(//button[contains(@class,"search-btn")])[1]';
    await page.waitForSelector(`xpath=${searchBtnSelector}`, { timeout: 5000 });

    // Click the search button
    await page.click(`xpath=${searchBtnSelector}`);

    // Wait for possible XSS effect or search result (wait for main content to update)
    // Use a generic wait for any change in the DOM (wait for a search results heading)
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 }).catch(() => {});

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Extract search results heading and check if payload is reflected
    let reflected = false;
    let headingText = '';
    try {
      const heading = await page.$('h2:has-text("Search Results")');
      if (heading) {
        headingText = await heading.textContent();
        if (headingText && headingText.includes(xssPayload)) {
          reflected = true;
        }
      }
    } catch {}

    // Also check if the payload appears anywhere in the page (as text)
    const pageContent = await page.content();
    const payloadReflected = pageContent.includes(xssPayload);

    return {
      success: true,
      action: "Attempted XSS via search input and triggered search, captured screenshots and checked for payload reflection.",
      extractedData: {
        headingText,
        reflectedInHeading: reflected,
        payloadReflectedInDOM: payloadReflected
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
